class Subject {
  private observers: Observer[] = [];

  // Add observer
  public register(observer: Observer): void {
    this.observers.push(observer);
  }

  public unregister(observer: Observer): void {
    const index = this.observers.indexOf(observer);
    if (index > -1) {
      this.observers.splice(index, 1);
    }
  }

  public notifyObservers(): void {
    for(let observer of this.observers) {
      observer.notify();
    }
  }
}

interface Observer {
  notify(): void;
}

class ConcreteObserver implements Observer {
  private id: number;
  private _counter: number;

  constructor(id: number) {
    this.id = id;
    this._counter = 0;
  }

  public notify(): void {
    this._counter++;
    console.log(`Observer ${this.id} has been notified!`);
    console.log(`Observer ${this.id} Counter: ${this.counter}`);
  }

  get counter(): number {
    return this._counter;
  }
}

let subject = new Subject();

let obs1 = new ConcreteObserver(1);
let obs2 = new ConcreteObserver(2);
let obs3 = new ConcreteObserver(3);

subject.register(obs1);
subject.register(obs2);
subject.register(obs3);

subject.notifyObservers();

