TreeNode<int>* MakeTree(int value, TreeNode<int>* parent, int depth, int max_depth) {
        auto new_node = new TreeNode<int>{value, parent, nullptr, nullptr}; 
        if (depth <= max_depth) {
            new_node->left = MakeTree(value - (1<<(max_depth - depth)), new_node, depth + 1, max_depth);
            new_node->right = MakeTree(value + (1<<(max_depth - depth)), new_node, depth + 1, max_depth);
        }
        return new_node;
    }

    void NextEffectiveness() {
        using namespace std;
        using T = TreeNode<int>;

        T* root = MakeTree(0, nullptr, 0, 20);
        cout << root << endl;

        T* iter = begin(root);

        while (iter) {
            cout << iter->value << " "s;
            iter = next(iter);
        }
        cout << endl;  
        
        DeleteTree(root);     
    }

#define _CRF_SECURE_NO_WARNINGS
#define _CRT_SECURE_NO_DEPRECATE
  
#include <stdio.h>
  
const int MaxN = 210;
const int MaxM = 210;
const int MaxK = 55;
  
int n, m, k;
char map[MaxN][MaxM];
char map2[MaxN][MaxN];
  
short column[MaxM][MaxN][MaxK];
short row[MaxN][MaxM][MaxK];
  
short left[MaxN][MaxK];
short right[MaxN][MaxK];
  
short max(short a, short b) { return a > b ? a : b; }
short min(short a, short b) { return a < b ? a : b; }
  
void CalculateRow(int m, char *map, int _k, short row[MaxN][MaxK])
{
    // left
    left[0][0] = map[0] == '.';
    for (int i = 1; i < m; ++i) {
        if (map[i] == '*') left[i][0] = 0;
        else left[i][0] = left[i - 1][0] + 1;
    }
  
    for (int k = 1; k <= _k; ++k) {
        left[0][k] = 1;
        for (int i = 1; i < m; ++i) {
            if (map[i] == '*') left[i][k] = left[i - 1][k - 1] + 1;
            else left[i][k] = left[i - 1][k] + 1;
        }
    }
  
    // right
    right[m - 1][0] = map[m - 1] == '.';
    for (int i = m - 2; i >= 0; --i) {
        if (map[i] == '*') right[i][0] = 0;
        else right[i][0] = right[i + 1][0] + 1;
    }
  
    for (int k = 1; k <= _k; ++k) {
        right[m - 1][k] = 1;
        for (int i = m - 2; i >= 0; --i) {
            if (map[i] == '*') right[i][k] = right[i + 1][k - 1] + 1;
            else right[i][k] = right[i + 1][k] + 1;
        }
    }
  
    // merge
    for (int i = 0; i < m; ++i) {
        if (map[i] == '*') row[i][0] = 0;
        else row[i][0] = left[i][0] + right[i][0] - 1;
    }
  
    for (int k = 1; k <= _k; ++k) {
        row[0][k] = right[0][k];
        row[m - 1][k] = left[m - 1][k];
  
        for (int i = 1; i < m - 1; ++i) {
            int newK = k;
            if (map[i] == '*') newK = k - 1;
  
            for (int leftK = 0; leftK <= newK; ++leftK) {
                int rightK = newK - leftK;
                row[i][k] = max( row[i][k], left[i - 1][leftK] + right[i + 1][rightK] + 1 );
            }
        }
  
    }
}
  
