            if(tmp_x >= 0) {
                for(int x = 0; x <= tmp_x; x++) {
                    int y = tmp_x - x;
                    int r_tmp = x + obstacle;
                    int c_tmp = y + obstacle;
                    result = max(result, rows[i][j][r_tmp] + cols[i][j][c_tmp] - 1);
                }
            }
        }
    }
    cout << result - 1 << endl;
    return 0;
}

