inline void add_edges(int u, int i, int v, int j) {
    g[inv(u)][i][v][j] = true;
    g[inv(v)][j][u][i] = true;
    gr[v][j][inv(u)][i] = true;
    gr[u][i][inv(v)][j] = true;
}

