void dfs1(int u, int i) {
    vis[u][i] = true;
    for (int j = 0; j < 2; ++j)
        for (int v = l; v <= r; v = next_free[u][i][v][j])
            if (g[u][i][v][j] && !vis[v][j])
                dfs1(v, j);

    for (int j = 0; j < 2; ++j)
        for (int v = l + n; v <= r + n; v = next_free[u][i][v][j])
            if (g[u][i][v][j] && !vis[v][j])
                dfs1(v, j);

    order.pb({u, i});
}

bool dfs2(int u, int i, int c) {
    comp[u][i] = c;
    vis[u][i] = true;
    if (comp[inv(u)][i] == c)
        return false;

    for (int j = 0; j < 2; ++j)
        for (int v = l; v <= r; v = next_free_rv[u][i][v][j])
            if (gr[u][i][v][j] && !vis[v][j] && !dfs2(v, j, c))
                    return false;

    for (int j = 0; j < 2; ++j)
        for (int v = l + n; v <= r + n; v = next_free_rv[u][i][v][j])
            if (gr[u][i][v][j] && !vis[v][j] && !dfs2(v, j, c))
                    return false;

    return true;
}

bool check(int p, int q) {
    l = p, r = q;
    order.clear();
    for (int i = l; i <= r; ++i)
        vis[i][0] = vis[i][1] = vis[i + n][0] = vis[i + n][1] = 0;

    for (int u = l; u <= r; ++u)
        for (int i = 0; i < 2; ++i)
            if (!vis[u][i])
                dfs1(u, i);

    for (int u = l + n; u <= r + n; ++u)
        for (int i = 0; i < 2; ++i)
            if (!vis[u][i])
                dfs1(u, i);

    reverse(all(order));
    for (int i = l; i <= r; ++i)
        vis[i][0] = vis[i][1] = vis[i + n][0] = vis[i + n][1] = 0;
    memset(comp, 0, sizeof(comp));

    int ptr = 1;

    for (point p : order)
        if (!vis[p.X][p.Y] && !dfs2(p.X, p.Y, ptr++))
            return false;

    return true;
}

